import React from "react";
import "./Slidetop.css";

const Slidetop = () => {
  return (
    <div className="slidetop">
      Slidetop
      <div className="carousel-slide">
        <div className="carousel-inner">
          <div className="item-active">
            <a href="#">
              <img
                className="img"
                src="https://techinplay.edu.vn/media/images/slider/02.jpg"
                alt="slide"
              />
            </a>
          </div>
          <div className="item-active"></div>
          <div className="item-active"></div>
          <div className="item-active"></div>
          <div className="item-active"></div>
        </div>
      </div>
    </div>
  );
};

export default Slidetop;
